import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import {
    get_items,
    get_total,
    get_item_total,
} from '../actions/cart';
import { list_orders } from '../actions/orders';

const Dashboard = ({
    orders,
    list_orders,
    get_items,
    get_total,
    get_item_total,
}) => {

    useEffect(() => {
        list_orders();
    }, []);
    return (
        <div>
            Dashboard
        </div>
    )
};

const mapStateToProps = state => ({
    orders: state.orders.orders
});

export default connect(mapStateToProps, {
    get_items,
    get_total,
    get_item_total,
    list_orders
})(Dashboard);
